import React from 'react';
import Button from '../Button/Button';
import './HeroSection.css';

const HeroSection = () => {
  return (
    <section className="hero-section" data-aos="fade-up">
      <h1>Empowering Your Business with Visionary Tech Solutions</h1>
      <p>
        At TechSaaS Vision, we provide innovative, scalable web
        development and SaaS solutions that drive success and foster
        growth.
      </p>
      <Button text="Get Started" />
    </section>
  );
};

export default HeroSection;
